import React from 'react';
import './NavBar.css'
import Logo from '../Logo/Logo';
import Carro from '../Carro/Carro'

const NavBar = (props) => {
    const { carro, mostrarCarro } = props
    return (
        <nav>
            <Logo/>
            <Carro carro={carro} mostrarCarro={mostrarCarro}/>
        </nav>
    );
};

export default NavBar;
